let memory = [];

function index(bank) {
  bank.on('upload', (files) => {
    const config = bank.getSetting('qiniu');
    const requiredSetting = ['bucket', 'secretKey', 'accessKey', 'uploadURL', 'origin'];
    for (let i = 0; i < requiredSetting.length; i++) {
      if (!config[requiredSetting[i]]) {
        bank.emit('tip', {
          visible: true,
          type: 'error',
          message: `缺少必要参数${requiredSetting[i]}`
        });
        return
      }
    }
    files.forEach(file => {
      const fileUpload = { 
        ...file,
        total: 0,
        loaded: 0,
        done: false,
        fail: false
      };
      memory.push(fileUpload);
      uploadFile(file.path, file.name, (progress) => {
        fileUpload.total = progress.total;
        fileUpload.loaded = progress.transferred;
        fileUpload.percent = progress.percent;
        if (fileUpload.percent === 1) {
          fileUpload.percent = 0.999;
          fileUpload.loaded = fileUpload.total *  0.999;
        }
        bank.emit('progress', memory);
      }, config).then(data => {
        if (data.success)  {
          fileUpload.loaded = fileUpload.total;
          fileUpload.percent = 1;
          fileUpload.done = true;
          fileUpload.key = data.data.key;
          fileUpload.w = data.data.w;
          fileUpload.h = data.data.h;
          fileUpload.hash = data.data.hash;
          fileUpload.link = data.data.link;
        } else {
          fileUpload.fail = true;
        }
        bank.emit('progress', memory);
      });
    });
  });

  bank.on('getUploadList', () => {
    bank.emit('uploadList', memory);
  });

  bank.on('clear', () => {
    memory = [];
  });
}

module.exports = index;
